import React, { Component } from "react";
import { FaAlignLeft, FaAlignRight } from 'react-icons/fa';
import "./Navbar.css";

export default class Navbar extends Component {
  state = {
    toggle: false
  }
  Toggle = () => {
    this.setState({toggle: !this.state.toggle})
  }
  render() {
    const li = [
      {
        link: "/",
        text:"HOME"
      },
      {
        link: "/our_team/",
        text:"OUR TEAM"
      },
      {
        link: "/join_us/",
        text:"JOIN US!"
      },
      {
        link: "/contact/",
        text:"CONTACT"
      }
    ];

    return (
      <header className = "Navbar">
          <div className = "Title">BECOMING<br/>BUSINESSWOMEN</div>
          <button onClick={this.Toggle}>
            <FaAlignLeft />
          </button>
          <ul className={this.state.toggle ? "links show-nav" : "links"}>
          {
            li.map((objLink, i) => { return ( <li><a href={objLink.link}>{objLink.text}</a></li> )})
          }
          </ul>
      </header>  
    );
  }
}
